import React from 'react'
import logo from './logo.png'
import './style/Kepala.css';

const Kepala = () => {
  return (
    <div>
        <header>
            <img src={logo} className="itera" alt="logo"/>
            <h3>Sistem Informasi Kompetisi</h3>
            <p>"Institut Teknologi Sumatera"</p>
        </header>
        
    </div>
  )
}

export default Kepala;
